import "./App.css";

import Logo from "./componentes/Logo/index";


const textOption = ['Categories']
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Logo></Logo>
        <ul className="options">
          <li className="option">
            <p>Categories</p>
          </li>
          <li className="option">
            <p>Library</p>
          </li>
          <li className="option">
            <p>Favorites</p>
          </li>
        </ul>
      </header>
    </div>
  );
}

export default App;
